    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE - 17 <> ( - - ( - + col1 ) + + 17 - - ( + 13 ) * 16 + col2 );
  - name: tab2

outputs:
  - name: q1634.out
    data: |
      46	51	23
      64	77	40
      75	67	58
